import 'dotenv/config';
import express from 'express';

import sum from './sum.js';
import callMyFunction from './callMyFunction.js';

import uuidv4 from 'uuid/v4';

const app = express();
app.use(express.json());
app.use(express.urlencoded({extended: true}));
app.use((req, res, next) => {
  req.me = users[1];
  next();
});

let i = 0;

const users = {
  1: {
    id: '1',
    username: 'Robin Wieruch',
  },
  2: {
    id: '2',
    username: 'Dave Davids',
  },
};
let messages = {
  1: {
    id: '1',
    text: 'Hello World',
    userId: '1',
  },
  2: {
    id: '2',
    text: 'Goodbye World',
    userId: '2',
  },
};

app.get('/', (req, res) => {
  return res.send('Received a GET HTTP method');
});

app.post('/', (req, res) => {
  return res.send('Received a POST HTTP method');
});

app.put('/', (req, res) => {
  return res.send('Received a PUT HTTP method');
});

app.delete('/', (req, res) => {
  return res.send('Received a DELETE HTTP method');
});

app.get('/users', (req, res) => {
  return res.send(Object.values(users));
});
app.get('/users/:userId', (req, res) => {
  return res.send(users[req.params.userId]);
});
app.post('/users', (req, res) => {
  return res.send('POST HTTP method on user resource');
});
app.put('/users/:userId', (req, res) => {
  return res.send(
      `PUT HTTP method on user/${req.params.userId} resource`,
  );
});
app.delete('/users/:userId', (req, res) => {
  return res.send(
      `DELETE HTTP method on user/${req.params.userId} resource`,
  );
});
app.get('/messages', (req, res) => {
  return res.send(Object.values(messages));
});
app.get('/messages/:messageId', (req, res) => {
  return res.send(messages[req.params.messageId]);
});

app.get('/test', (req, res) => {
  i++;
  res.send('Hello Test!'+i.toString()+'\n');
});

app.get('/session', (req, res) => {
  return res.send(users[req.me.id]);
});

app.post('/messages', (req, res) => {
  console.log(`debug: req.body is: ${JSON.stringify(req.body, null, 4)}`);
  //  console.log(`debug: req is: ${req}`);
  const id = uuidv4();
  const message = {
    id,
    text: req.body.text,
    userId: req.me.id,
  };
  messages[id] = message;
  return res.send(message);
});

app.delete('/messages/:messageId', (req, res) => {
  const {
    [req.params.messageId]: message,
    ...otherMessages
  } = messages;

  messages = otherMessages;

  return res.send(message);
});

app.update('/messages/:messageId', (req, res) => {});

console.log('Hello, Project.');
console.log(process.env.MY_SECRET);

console.log(sum(1, 2));

callMyFunction(function() {
  console.log('Hello world');
});

app.listen(process.env.PORT, () =>
  console.log('example app listening on port 3000!'),
);

